    // const expenseTitle="car insurenece";
    // const expenseAmount="5454"; /
   
    return (
        <div className="expense-item">
       {ExpenseDate()}
        <div className="expense-item__description">
            <h2>{props.title}</h2>
            <div className="expense-item__price">{props.amount}</div>
        </div>
        </div>
    )
}
export default ExportItem;
